import axios from "axios";

import "./Test.css";

import Card from "./components/Card/Card";

function Test() {
  const [data, setData] = useState({
    imgSrc1: "",
    link1: "",

    imgSrc2: "",
    link2: "",

    imgSrc3: "",
    link3: "",

    imgSrc4: "",
    link4: "",

    imgSrc5: "",
