    imgSrc16: "",
    link16: "",

    imgSrc17: "",
    link17: "",

    imgSrc18: "",
    link18: "",

    imgSrc19: "",
    link19: "",

    imgSrc20: "",
    link20: "",
  });
  const [recipes, setRecipes] = useState([]);
  const getRecipe = async (query) => {
    const response = await axios.get(
      `https://api.edamam.com/api/recipes/v2?type=public&q=${query}&app_id=48749e6b&app_key=%20e48b4d118c5df082474141e6e4746f1a`
    );
    console.log(response.data.hits);
    setRecipes(response.data.hits);
  };
  return (
    <form
      autoComplete="off"
      onSubmit={(e) => {
        e.preventDefault();
        const username = e.target.elements.usernameInput.value;
        if (!username) {
          return alert("Please enter username");
        } else {
          return getRecipe(username);
        }
      }}
    >
      <input type="text" id="usernameInput" placeholder="Enter a username..." />
      <button type="submit">Submit</button>
      {recipes.map((recipe) => (
        <div class="grid">
          <div class="card">
            <img
              src="https://images.unsplash.com/photo-1640273296098-57ce421286d8?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=687&q=80"
              alt="Sample photo"
            />
            <div class="text">
              <h3>Seamlessly visualize quality</h3>
              <p>
                Collaboratively administrate empowered markets via plug-and-play
                networks.
              </p>
              <button>Here's why</button>
            </div>
          </div>
        </div>
      ))}
    </form>
  );
}

export default Test;
